export default function Eduction(props){
    let education=props.content;
    return(
        <div class="flex gap-3">
            {
                education.map((el)=>(
                    <div className="card bg-slate-0 flex gap-3">
                            <img src={el.image} className="dropShadow w-1/2"></img>
                        <div>
                            <p className="text-indigo-500 font-bold">{el.degree}</p>
                            <p className="font-bold">{el.institute}</p>
                            <p className="text-slate-500 font-bold">{el.duration}</p>
                        </div>
                    </div>
                ))
            }
        </div>
    )
}
